import React from 'react';

class Form extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return <form>
                <label>Email ID: <input type="text" name="email" value="enter email id"/></label>
                <label>Password: <input type="text" name="password" value="enter password"/></label>
                <label>Confirmation: <input type="text" value="confirm password"/></label>
                <input type="submit" value="Sign Up"/>
            </form>
    }
}
export default Form;
